import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";

import Button from "./Button";

export default function DownloadButton(props) {
  return (
    <div>
      <h2
        css={css`
          margin-bottom: 8px;
        `}
      >
        Featured Projects:
      </h2>
      {props.type}
    </div>
  );
}
